function Education() {
  return (
    <div className="education-container">
      <h2>Education</h2>

      <div className="education-item">
        <h3>Master of Science (M.S.) in Computer Science and Information Systems</h3>
        <p><strong>University:</strong> The University of Texas at Arlington, Arlington, TX</p>
        <p><strong>Graduation:</strong> May 2025</p>
        <p><strong>Coursework:</strong> Design and Analysis of Algorithms, Data Structures, Data Analysis & Managing Techniques, Artificial Intelligence, Web Data Management, Data Mining, Cloud Computing & Big Data, Machine Learning, Software Engineering II, Numerical Methods</p>
      </div>

      <div className="education-item">
        <h3>Bachelor of Technology (B.Tech) in Computer Science</h3>
        <p><strong>University:</strong> Vignanâ€™s University, Andhra Pradesh, India</p>
        <p><strong>Graduation:</strong> May 2023</p>
        <p><strong>Coursework:</strong> Machine Learning, Cloud Computing, Big Data & Analytics, Artificial Intelligence, Mobile Computing, Cryptography & Network Security, Software Engineering, Computer Networks, Operating Systems, Compiler Design, Web Technologies, DBMS, Data Structures, OOPs through Java, C Language</p>
      </div>
    </div>
  );
}

export default Education;
